#include <algorithm>
#include <iostream>
#include <array>
#include <vector>
#include <numeric>
#include <random>
#include <chrono>
#include <set>
#include <map>
#include <queue>

using namespace std;

#define int long long

const int INF = 1e18 + 7;
const int MAXN = 40010;
const int N = 1e5 + 10;
const int B = 666;

array<int, MAXN> a, sum, mini, add, ass;
int n;

void build() {
    add.fill(0);
    ass.fill(-1);
    sum.fill(0);
    mini.fill(INF);

    for (int i = 0; i < n; ++i) {
        sum[i / B] += a[i];
        mini[i / B] = min(mini[i / B], a[i]);
    }
}

inline int get(int i) {
    return (ass[i / B] == -1 ? a[i] : ass[i / B]) + add[i / B];
}

void push(int block) {
    for (int i = block * B; i < min(n, (block + 1) * B); ++i) {
        a[i] = get(i);
    }
    ass[block] = -1;
    add[block] = 0;
}

void recalc(int block) {
    mini[block] = INF;
    for (int i = block * B; i < min(n, (block + 1) * B); ++i) {
        mini[block] = min(mini[block], get(i));
    }
}

inline void addVal(int l, int r, int x) {
    push(l / B);
    push(r / B);

    for (int i = l; i <= r; ) {
        if (i % B == 0 && i + B - 1 <= r) {
            add[i / B] += x;
            mini[i / B] += x;
            sum[i / B] += x * B;
            i += B;
        } else {
            a[i] += x;
            sum[i / B] += x;
            ++i;
        }
    }

    recalc(l / B);
    recalc(r / B);
}


inline void upd(int l, int r, int x) {
    push(l / B);
    push(r / B);

    for (int i = l; i <= r; ) {
        if (i % B == 0 && i + B - 1 <= r) {
            ass[i / B] = x;
            add[i / B] = 0;
            mini[i / B] = x;
            sum[i / B] = x * B;
            i += B;
        } else {
            sum[i / B] -= a[i];
            a[i] = x;
            sum[i / B] += a[i];
            ++i;
        }
    }

    recalc(l / B);
    recalc(r / B);
}


inline int getSum(int l, int r) {
    int ans = 0;
    while (l <= r) {
        if (l % B == 0 && l + B - 1 <= r) {
            ans += sum[l / B];
            l += B;
        } else {
            ans += get(l);
            ++l;
        }
    }
    return ans;
}

inline int getMin(int l, int r) {
    int ans = INF;
    while (l <= r) {
        if (l % B == 0 && l + B - 1 <= r) {
            ans = min(ans, mini[l / B]);
            l += B;
        } else {
            ans = min(ans, get(l));
            ++l;
        }
    }
    return ans;
}

signed main() {
    ios_base::sync_with_stdio(false);
    cin.tie(nullptr);

    cin >> n;
    for (int i = 0; i < n; ++i) {
        cin >> a[i];
    }
    build();
    int q;
    cin >> q;
    while (q--) {
        string type;
        cin >> type;
        if (type == "get") {
            int i;
            cin >> i;
            --i;
            cout << get(i) << '\n';
        } else if (type == "update") {
            int l, r, x;
            cin >> l >> r >> x;
            --l, --r;
            upd(l, r, x);
        } else if (type == "add") {
            int l, r, x;
            cin >> l >> r >> x;
            --l, --r;
            addVal(l, r, x);
        } else if (type == "rsq") {
            int l, r;
            cin >> l >> r;
            --l, --r;
            cout << getSum(l, r) << '\n';
        } else if (type == "rmq") {
            int l, r;
            cin >> l >> r;
            --l, --r;
            cout << getMin(l, r) << '\n';
        }
    }
}

