#include <algorithm>
#include <iostream>
#include <array>
#include <vector>
#include <numeric>
#include <random>
#include <chrono>
#include <set>
#include <map>
#include <queue>

using namespace std;

const long long INF = 1e9 + 7;
const int MAXN = 1e5 + 10;
const int N = 1e5 + 10;
const int MAX_VALUE = 1e6 + 1;
const int B = 1000;

struct Query {
    int l, r, i;

    Query() = default;

    Query(int l_, int r_, int i_) : l(l_), r(r_), i(i_) {};
};

bool comp(const Query& lhs, const Query& rhs) {
    return lhs.l / B < rhs.l / B || lhs.l / B == rhs.l / B && lhs.r < rhs.r;
}

int k;
int mp[MAX_VALUE];
int ans = 0;

inline void add(int x) {
    ++mp[x];
    if (mp[x] == k + 1) {
        --ans;
    } else if (mp[x] == k) {
        ++ans;
    }
}

inline void pop(int x) {
    --mp[x];
    if (mp[x] == k - 1) {
        --ans;
    } else if (mp[x] == k) {
        ++ans;
    }
}

signed main() {
    ios_base::sync_with_stdio(false);
    cin.tie(nullptr);

    int n, m, q;
    cin >> n >> m >> q >> k;
    vector<int> a(n);
    for (int i = 0; i < n; ++i) {
        cin >> a[i];
    }
    if (k == 0) {
        ans = m;
    }
    vector<Query> ask;
    for (int i = 0; i < q; ++i) {
        int l, r;
        cin >> l >> r;
        ask.emplace_back(l - 1, r - 1, i);
    }
    sort(ask.begin(), ask.end(), comp);
    int left = 0, right = -1;
    vector<int> answer(q);
    for (int i = 0; i < q; ++i) {
        const auto [l, r, pos] = ask[i];
        while (right < r) {
            add(a[++right]);
        }
        while (left > l) {
            add(a[--left]);
        }
        while (right > r) {
            pop(a[right--]);
        }
        while (left < l) {
            pop(a[left++]);
        }
        answer[pos] = ans;
    }

    for (const auto i : answer) {
        cout << i << '\n';
    }
}

#include <bits/stdc++.h>

using namespace std;

typedef long long ll;
#define pb push_back
const int N = 6e5 + 1, INF = 1e9 + 7;
vector<vector<pair<int, int>>> g(N);
vector<pair<int, int>> p(N, {-1, 0});
vector<int> sz(N, 0);
vector<bool> cen(N, false);

void calc_sz(int v, int pr = -1) {
  sz[v] = 1;
  for (auto [it, w] : g[v]) {
    if (it == pr || cen[it]) {
      continue;
    }
    calc_sz(it, v);
    sz[v] += sz[it];
  }
}

int find_cen(int v, int n, int pr = -1) {
  for (auto [it, w] : g[v]) {
    if (it == pr || cen[it]) {
      continue;
    }
    if (sz[it] > n / 2) {
      return find_cen(it, n, v);
    }
  }
  return v;
}

void built(int v, int pr = -1, int len = 0) {
  calc_sz(v);
  int n = sz[v];
  int u = find_cen(v, n);
  cen[u] = true;
  p[u] = {pr, len};
  for (auto [it, w] : g[u]) {
    if (!cen[it] && it != pr) {
      built(it, u, w);
    }
  }
}

int n;
vector<int> logor(4 * N, 0);
vector<int> ord;
vector<int> vh(N);
vector<bool> used(N, false);
vector<int> he(N, 0);
vector<vector<int>> mini(N, vector<int>(22));
vector<vector<int>> ans(N, vector<int>(22));

void dfs(int v) {
  used[v] = true;
  ord.push_back(v);
  vh[v] = ord.size() - 1;
  for (auto [it, w] : g[v]) {
    if (!used[it]) {
      he[it] = he[v] + w;
      dfs(it);
      ord.push_back(v);
    }
  }
}

int logi(int x) {
  if (x == 1 || x == 0) {
    return 0;
  }
  logor[x] = logi(x / 2) + 1;
  return logor[x];
}

void LCA() {
  assert(ord.size() <= N);
  vector<int> a;
  dfs(0);
  for (int i = 2; i <= 4 * n + 1; ++i) {
    logi(i);
  }
  for (int i = 0; i < ord.size(); ++i) {
    a.push_back(he[ord[i]]);
  }
  int n1 = n;
  n = ord.size();
  for (int i = 0; i < n; ++i) {
    for (int j = 0; j < logor[n] + 2; ++j) {
      mini[i][j] = 1e9 + 7;
      ans[i][j] = i;
    }
  }
  for (int j = 0; j < logor[n] + 2; ++j) {
    for (int i = 0; i < n; ++i) {
      if (j == 0) {
        mini[i][j] = a[i];
        ans[i][j] = i;
      } else {
        if ((1 << (j - 1)) + i >= n) {
          mini[i][j] = mini[i][j - 1];
          ans[i][j] = ans[i][j - 1];
          continue;
        }
        if (mini[i][j - 1] < mini[i + (1 << (j - 1))][j - 1]) {
          ans[i][j] = ans[i][j - 1];
        } else {
          ans[i][j] = ans[i + (1 << (j - 1))][j - 1];
        }
        mini[i][j] = min(mini[i][j - 1], mini[i + (1 << (j - 1))][j - 1]);
      }
    }
  }
  n = n1;
}

int find_LCA(int u1, int u2) {
  long long sum = 0;
  long long ans1;
  int u = vh[u1], v = vh[u2];
  if (u > v) {
    u = vh[u2];
    v = vh[u1];
  }
  if (mini[u][logor[v - u]] < mini[v - (1 << logor[v - u]) + 1][logor[v - u]]) {
    ans1 = ans[u][logor[v - u]];
  } else {
    ans1 = ans[v - (1 << logor[v - u]) + 1][logor[v - u]];
  }
  return ord[ans1];
}

