struct rq{
    int l, r, tm;

    rq(int _l, int _r, int _tm){
        l = _l;
        r = _r;
        tm = _tm;
    }

};

struct u {
    bool f;
    int pos, prx, x;

    u(){
        f = false;
    }

    u(int _pos, int _prx, int _x){
        f = true;
        pos  = _pos;
        prx = _prx;
        x = _x;
    }
};

int k;

bool cmp(rq &a, rq &b){
    if (a.l / k == b.l / k){
        if (a.r / k == b.r / k)
            return a.tm < b.tm;
        return ((a.r * (a.l / k % 2 == 1 ? -1 : 1)) < (b.r * (a.l / k % 2 == 1 ? -1 : 1)));
    }
    return a.l < b.l;
}

int cnt[310000], mx[310000];

void del(int x){
    if (cnt[x] == 1){
        mx[cnt[x]]--;
        cnt[x]--;
    }
    else{
        mx[cnt[x]]--;
        cnt[x]--;
        mx[cnt[x]]++;
    }
}

void add(int x){
    if (cnt[x] == 0){
        cnt[x]++;
        mx[cnt[x]]++;
    }
    else{
        mx[cnt[x]]--;
        cnt[x]++;
        mx[cnt[x]]++;
    }
}

