                        newcheck = goSize+UDim2.new(0,0,0,25)
                        newcon = goSize
            
            
                        newy = UDim2.new(1,0,0,(self.container.Size.Y.Offset+newcon.Y.Offset))
                        self.container:TweenSize(newy,'Out','Quad',0.1,true)
                        check:TweenSize(newcheck, 'Out', 'Quad', 0.15, true)
